import React from 'react';
import { Link } from 'react-router-dom';
import notFound from '../../images/404.jpg'
import './NotFound.css'

const NotFound = () => {
    return (
        <div className="not-found">
            <img src={notFound}></img>
            <Link to="/"><button>Go Back</button></Link>
        </div>
    );
};

export default NotFound;
